package net.coderbee.leetcode.algorithm.strings;

import static org.junit.Assert.*;

import java.util.Arrays;

import org.junit.Test;

public class FindAnagramsTest {

	@Test
	public void test() throws Exception {
		assertEquals(Arrays.asList(0, 6), FindAnagrams.findAnagrams("cbaebabacd", "abc"));
		assertEquals(Arrays.asList(0, 1, 2), FindAnagrams.findAnagrams("abab", "ab"));
		assertEquals(Arrays.asList(0, 10001), FindAnagrams.findAnagrams(
				"",
				""));
	}

}
